	(453, 23, 1, 227, 'Nous pensons que de vouloir savoir toutes, certaines out aucune des informations à propos de votre maladie est particulier à chaque patient. Les gens font face à leur maladie de manières différentes. Certains patients préfèrent avoir tous les détails sur leur maladie, certains préfèent avoir une quantité limitée d\'information, certains préfèrent ne rien savoir ou avoir très peu d\'information, et certains préfèrent que leur famile sache à leur place. Que préfèrez-vous?', 0, '', '2019-07-19 13:47:33', 'QUESTIONNAIRE_MIGRATION_2019', '2019-07-19 13:47:33', 'QUESTIONNAIRE_MIGRATION_2019'),
	(454, 23, 2, 227, 'We believe that wanting to know all, some or none of the information about your disease is particular to each patient. People cope with their illness differently. Some patients like to know all of the details about their disease, some prefer limited information, some prefer not to know or to know very little, and some prefer that their family knows on their behalf. What do you prefer?', 0, '', '2019-07-19 13:47:33', 'QUESTIONNAIRE_MIGRATION_2019', '2019-07-19 13:47:33', 'QUESTIONNAIRE_MIGRATION_2019'),
